INSERT INTO `tl_content` (`id`, `type`, `pid`, `ptable`, `sorting`, `tstamp`, `headline`, `text`, `addImage`, `showPreview`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `markdownSource`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `data`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`) VALUES (193, 'text', 12, 'tl_article', 384, 1396271128, 'a:2:{s:4:\"unit\";s:2:\"h3\";s:5:\"value\";s:0:\"\";}', '<h3>Contao Official Demo</h3>\n<p>Für die Contao Official Demo gebührt der Dank folgenden Personen:</p>\n<p>Das Screendesign wurde von borowiakziehe KG gesponsort und von Hannes Oertel gestaltet.</p>\n<p>Umsetzung:</p>\n<ol>\n<li>Joe Ray Gregory | <a href=\"http://borowiakziehe.de/\" target=\"_blank\">borowiakziehe.de</a></li>\n<li>Sascha Müller | <a href=\"http://bytepuzzle.de/\" target=\"_blank\">bytepuzzle.de</a></li>\n<li>Felix Pfeiffer | <a href=\"http://www.felixpfeiffer.com/\" target=\"_blank\">www.felixpfeiffer.com</a></li>\n<li>Stefan Eipeltauer | <a href=\"http://www.craftandvalue.com/\" target=\"_blank\">www.craftandvalue.com</a></li>\n</ol>\n<p><strong>Helfer und Tester:</strong> Alexander[nbsp]Bröss, Christian[nbsp]de[nbsp]la[nbsp]Haye, Fabian[nbsp]Fauth, Carolina[nbsp]Köhn, Dolores[nbsp]Moser, Yanick[nbsp]Witschi, Marc[nbsp]Reimann, Lars[nbsp]Tubies, Stefan[nbsp]Lindecke, Oliver[nbsp]Lohoff und Marie[nbsp]Dietz.</p>\n<h3>Isotope eCommerce Demo</h3>\n<p>Umsetzung:</p>\n<ol>\n<li>Bjarke Ammann | <a href=\"http://www.netzarbeiter.ch/\" target=\"_blank\">netzarbeiter</a></li>\n</ol>\n<p>Die Daten für den CD-Bereich hat uns <a href=\"http://www.cede.ch/\" target=\"_blank\">cede.ch</a> zur Verfügung gestellt.</p>\n<p><a href=\"http://www.weitzeldesign.com/\" target=\"_blank\">Thomas Weitzel</a> hat mir in einer Nacht-und-Nebel-Aktion das T-Shirt auf den Leib geschneidert.</p>\n<p>Die Icons von <a href=\"http://fortawesome.github.io/Font-Awesome/\" target=\"_blank\">Font Awesome</a> runden das Design ab.</p>\n<p>Zu guter Letzt - ein riesiges Dankeschön an Leo Feyer und das Contao-Team für ein grossartiges <a href=\"https://contao.org/\" target=\"_blank\">CMS</a>.</p>', '', '', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', '', '', '', NULL, NULL, 0, 300, 0, '', NULL, 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '');
