INSERT INTO `tl_iso_product` (`id`, `pid`, `gid`, `tstamp`, `language`, `dateAdded`, `type`, `orderPages`, `inherit`, `fallback`, `alias`, `gtin`, `sku`, `name`, `teaser`, `description`, `meta_title`, `meta_description`, `meta_keywords`, `baseprice`, `shipping_weight`, `shipping_exempt`, `shipping_pickup`, `shipping_price`, `images`, `protected`, `groups`, `guests`, `cssID`, `published`, `start`, `stop`, `contao`, `version`, `date`, `tracks`, `size`, `colour`, `hitCount`) VALUES (152, 0, 5, 1504881720, '', 1393516565, 4, 'a:2:{i:0;s:2:\"60\";i:1;s:2:\"61\";}', NULL, '', 'contao-open-source-cms', '', '2006', 'Contao Open Source CMS', 'Download', '<p>Contao ist ein Open Source Content Management System (CMS) für alle, die Wert auf eine professionelle Internetpräsenz legen und diese einfach pflegen möchten. Die moderne Architektur des Systems bietet einen hohen Sicherheitsstandard, erlaubt die Entwicklung suchmaschinenfreundli[-]cher und barrierefreier Webseiten und ist flexibel und kostengünstig erweiterbar. Eine umfangreiche Rechteverwaltung, der Live Update Service, das moderne CSS-Framework und viele von Haus aus integrierte Module (News, Kalender, Formulare etc.) haben Contao in kürzester Zeit zu einem der beliebtesten Systeme am Markt für Open Source CMS gemacht.</p>', '', NULL, NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:2:\"kg\";}', '', '', '0.00', 'a:1:{i:0;a:5:{s:3:\"src\";s:10:\"contao.png\";s:3:\"alt\";s:22:\"Contao Open Source CMS\";s:4:\"link\";s:0:\"\";s:4:\"desc\";s:0:\"\";s:9:\"translate\";s:4:\"none\";}}', '', NULL, '', '', '1', '', '', 0, '', '', '', '', '', 0);
INSERT INTO `tl_iso_product` (`id`, `pid`, `gid`, `tstamp`, `language`, `dateAdded`, `type`, `orderPages`, `inherit`, `fallback`, `alias`, `gtin`, `sku`, `name`, `teaser`, `description`, `meta_title`, `meta_description`, `meta_keywords`, `baseprice`, `shipping_weight`, `shipping_exempt`, `shipping_pickup`, `shipping_price`, `images`, `protected`, `groups`, `guests`, `cssID`, `published`, `start`, `stop`, `contao`, `version`, `date`, `tracks`, `size`, `colour`, `hitCount`) VALUES (161, 152, 0, 1393579780, 'en', 0, 0, NULL, NULL, '', '', '', '', 'Contao Open Source CMS', 'Download', '<p>Contao is an open source content management system (CMS) for people who want a professional internet presence that is easy to maintain. The state-of-the-art structure of the system offers a high security standard and allows you to develop search engine friendly websites that are also accessible for people with disabilities. Furthermore, the system can be expanded flexibly and inexpensively. Easy management of user rights, the Live Update Service, the modern CSS framework and many already integrated modules (news, calendar, forms, etc.) have quickly made Contao one of the most popular open source content management systems on the market.</p>', '', NULL, NULL, '', '', '', '', '0.00', 'a:1:{i:0;a:2:{s:3:\"src\";s:10:\"contao.png\";s:9:\"translate\";s:3:\"all\";}}', '', NULL, '', '', '', '', '', 0, '', '', '', '', '', 0);
