INSERT INTO `tl_iso_product` (`id`, `pid`, `gid`, `tstamp`, `language`, `dateAdded`, `type`, `orderPages`, `inherit`, `fallback`, `alias`, `gtin`, `sku`, `name`, `teaser`, `description`, `meta_title`, `meta_description`, `meta_keywords`, `baseprice`, `shipping_weight`, `shipping_exempt`, `shipping_pickup`, `shipping_price`, `images`, `protected`, `groups`, `guests`, `cssID`, `published`, `start`, `stop`, `contao`, `version`, `date`, `tracks`, `size`, `colour`, `hitCount`) VALUES (211, 152, 0, 1504881702, 'de', 0, 0, NULL, NULL, '', '', '', '', 'Contao Open Source CMS', 'Download', '<p>Contao ist ein Open Source Content Management System (CMS) für alle, die Wert auf eine professionelle Internetpräsenz legen und diese einfach pflegen möchten. Die moderne Architektur des Systems bietet einen hohen Sicherheitsstandard, erlaubt die Entwicklung suchmaschinenfreundli[-]cher und barrierefreier Webseiten und ist flexibel und kostengünstig erweiterbar. Eine umfangreiche Rechteverwaltung, der Live Update Service, das moderne CSS-Framework und viele von Haus aus integrierte Module (News, Kalender, Formulare etc.) haben Contao in kürzester Zeit zu einem der beliebtesten Systeme am Markt für Open Source CMS gemacht.</p>', '', NULL, NULL, '', '', '', '', '0.00', 'a:1:{i:0;a:5:{s:3:\"src\";s:10:\"contao.png\";s:3:\"alt\";s:22:\"Contao Open Source CMS\";s:4:\"link\";s:0:\"\";s:4:\"desc\";s:0:\"\";s:9:\"translate\";s:4:\"none\";}}', '', NULL, '', '', '', '', '', 0, '', '', '', '', '', 0);
